import { Box, Typography } from "@mui/material";
import React from "react";

function PlayStore() {
  return (
    <Box
      sx={{
        display: "flex",
        flexDirection: "column",
        alignItems: "flex-start", // Align everything to the left
        maxWidth: "100%", // Prevent overflow
        margin: "0 auto",
        padding: "50px 55px",
        height: "600px",
        backgroundColor: "#e3f2fd",
        marginTop: "100px",
        textAlign: "start",
      }}
    >
      {/* Heading */}
      <Typography
        sx={{
          fontFamily: "Manrope, sans-serif !important",
          fontSize: "2.9rem",
          fontWeight: "700",
          lineHeight: 1.2,
          letterSpacing: "0.015em",
          wordSpacing: "0.001em",
          marginBottom: "10px",
        }}
      >
        Download the{" "}
        <Box
          component="span"
          sx={{
            color: "#3593b0",
            position: "relative",
            display: "inline-block",
            "&::after": {
              content: '""',
              position: "absolute",
              left: 0,
              bottom: "-5px",
              width: "100%",
              height: "4px",
              backgroundColor: "black",
              borderRadius: "5px",
            },
          }}
        >
          MyMoneyMantra
        </Box>
        <br />
        Mobile App
      </Typography>

      {/* List Items */}
      <Box
        sx={{
          fontFamily: "Manrope, sans-serif !important",
          fontSize: "1.4rem",
          fontWeight: "600",
          color: "black",
          marginBottom: "20px", // Adds space between list and images
        }}
      >
        <ul
          style={{
            listStyleType: "none",
            padding: 0,
            margin: 0,
            lineHeight: "1.8", // Reduce space between list items
          }}
        >
          <li>âœ… Enjoy a seamless experience.</li>
          <li>ðŸ’³ Get exclusive Loans and Credit Card offers.</li>
          <li>ðŸ“Š Track your credit score anytime, anywhere.</li>
        </ul>
      </Box>

      {/* Images Below the List */}
      <Box
        sx={{
          display: "flex",
          gap: "15px", // Space between images
          marginTop: "10px", // Ensures proper spacing
        }}
      >
        <img
          src="/playstore/pic1.jpg"
          alt="Play Store"
          style={{ width: "160px", height: "auto", cursor: "pointer" }}
        />
        <img
          src="/playstore/pic2.jpg"
          alt="App Store"
          style={{ width: "160px", height: "auto", cursor: "pointer" }}
        />
      </Box>
    </Box>
  );
}

export default PlayStore;
